import React from 'react';
import { motion } from 'framer-motion';
import { useInView } from 'react-intersection-observer';
import { GraduationCap, Code, Brain, Database } from 'lucide-react';

const About: React.FC = () => {
  const [ref, inView] = useInView({
    triggerOnce: true,
    threshold: 0.1,
  });

  const skills = [
    { name: 'C++', category: 'Programming' },
    { name: 'Python', category: 'Programming' },
    { name: 'React', category: 'Frontend' },
    { name: 'TensorFlow', category: 'AI/ML' },
    { name: 'Flask', category: 'Backend' },
    { name: 'Docker', category: 'DevOps' },
    { name: 'PostgreSQL', category: 'Database' },
    { name: 'JavaScript', category: 'Programming' },
    { name: 'Node.js', category: 'Backend' },
    { name: 'Git', category: 'Tools' },
  ];

  const education = [
    {
      year: '2020 - 2024',
      degree: 'B.Tech, Computer Science',
      institution: 'JUET',
      gpa: 'GPA: 9.7',
    },
  ];

  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        staggerChildren: 0.1,
      },
    },
  };

  const itemVariants = {
    hidden: { opacity: 0, y: 20 },
    visible: { opacity: 1, y: 0 },
  };

  return (
    <section id="about" className="section-padding bg-gray-50 dark:bg-dark-800">
      <div className="container-custom">
        <motion.div
          ref={ref}
          initial="hidden"
          animate={inView ? 'visible' : 'hidden'}
          variants={containerVariants}
          className="text-center mb-16"
        >
          <motion.h2
            variants={itemVariants}
            className="text-3xl sm:text-4xl lg:text-5xl font-bold text-gray-900 dark:text-white mb-4"
          >
            About <span className="gradient-text">Me</span>
          </motion.h2>
          <motion.p
            variants={itemVariants}
            className="text-lg text-gray-600 dark:text-gray-400 max-w-3xl mx-auto"
          >
            A passionate Full Stack Developer and AI/ML enthusiast with a strong foundation in computer science and a drive for innovation.
          </motion.p>
        </motion.div>

        <div className="grid lg:grid-cols-2 gap-12 items-start">
          {/* Education Timeline */}
          <motion.div
            initial="hidden"
            animate={inView ? 'visible' : 'hidden'}
            variants={containerVariants}
            className="space-y-8"
          >
            <motion.h3
              variants={itemVariants}
              className="text-2xl font-bold text-gray-900 dark:text-white mb-6 flex items-center"
            >
              <GraduationCap className="h-6 w-6 mr-3 text-primary-500" />
              Education
            </motion.h3>

            {education.map((edu, index) => (
              <motion.div
                key={index}
                variants={itemVariants}
                className="relative pl-8 border-l-2 border-primary-500"
              >
                <div className="absolute -left-2 top-0 w-4 h-4 bg-primary-500 rounded-full"></div>
                <div className="mb-2">
                  <span className="text-sm text-primary-500 font-medium">{edu.year}</span>
                </div>
                <h4 className="text-lg font-semibold text-gray-900 dark:text-white">
                  {edu.degree}
                </h4>
                <p className="text-gray-600 dark:text-gray-400">{edu.institution}</p>
                <p className="text-primary-500 font-medium">{edu.gpa}</p>
              </motion.div>
            ))}
          </motion.div>

          {/* Skills */}
          <motion.div
            initial="hidden"
            animate={inView ? 'visible' : 'hidden'}
            variants={containerVariants}
            className="space-y-6"
          >
            <motion.h3
              variants={itemVariants}
              className="text-2xl font-bold text-gray-900 dark:text-white mb-6 flex items-center"
            >
              <Code className="h-6 w-6 mr-3 text-primary-500" />
              Skills & Technologies
            </motion.h3>

            <div className="grid grid-cols-2 sm:grid-cols-3 gap-4">
              {skills.map((skill, index) => (
                <motion.div
                  key={skill.name}
                  variants={itemVariants}
                  className="p-4 bg-white dark:bg-dark-700 rounded-lg shadow-sm hover:shadow-md transition-shadow duration-200 border border-gray-200 dark:border-gray-600"
                >
                  <div className="text-center">
                    <div className="text-sm text-gray-500 dark:text-gray-400 mb-1">
                      {skill.category}
                    </div>
                    <div className="font-semibold text-gray-900 dark:text-white">
                      {skill.name}
                    </div>
                  </div>
                </motion.div>
              ))}
            </div>

            {/* Key Highlights */}
            <motion.div
              variants={itemVariants}
              className="mt-8 space-y-4"
            >
              <div className="flex items-center space-x-3">
                <Brain className="h-5 w-5 text-primary-500" />
                <span className="text-gray-700 dark:text-gray-300">
                  AI/ML Enthusiast with hands-on experience in TensorFlow
                </span>
              </div>
              <div className="flex items-center space-x-3">
                <Database className="h-5 w-5 text-primary-500" />
                <span className="text-gray-700 dark:text-gray-300">
                  Full-stack development with modern technologies
                </span>
              </div>
              <div className="flex items-center space-x-3">
                <Code className="h-5 w-5 text-primary-500" />
                <span className="text-gray-700 dark:text-gray-300">
                  500+ LeetCode problems solved
                </span>
              </div>
            </motion.div>
          </motion.div>
        </div>
      </div>
    </section>
  );
};

export default About;
